import React, { Component } from 'react';

class InfoCard extends Component{
    render(){
        return(
        <div class="row">
            <div class="col">
                <p>INFO CARD 1</p>
            </div>
            <div class="col">
                <p>INFO CARD 2</p>
            </div>
                <div class="col">
            <p>INFO CARD 3</p>
            </div>
        </div>
        )
    }
}

export default InfoCard;
